import logo from "../images/Code_Monkey_BW.png"; //placeholder images
import colorLogo from "../images/Code_Monkey.png";

const Nav = ({ minimal }) => {
  return (
    <nav>
      <div className="logo-container">
        <img className="logo" src={minimal ? colorLogo : logo} />
      </div>
    </nav>
  );
};

export default Nav;
